import { createSlice } from "@reduxjs/toolkit";

export const userSlice = createSlice({
  name:"user",
  initialValue:
  {value: {customerName:"Reshma",dob:"06-12-1994",city:"San",state:"Cali",country:"India",nickName:"Resh",email:"abc@msm.com",phone:"123-432-345"}},
  reducers:{
    login: (state,action) => {
      state.value=action.payload;

    }
  }
});

export default userSlice.reducer;
